import './style.less'

const ArticleList = (props) => {
  const { dataSource } = props
  return <div className="article-list">
    {
      dataSource.map(item => {
        const { article_title, article_id, article_time } = item
        return (
          <div key={article_id}>
            <a href="">{article_title}</a>
            <span>({article_time})</span>
          </div>
        )
      })
    }
  </div>
}

export default ArticleList
